import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";

const Dashboard = () => {
  const navigate = useNavigate();

  useEffect(() => {
    const isLoggedIn = localStorage.getItem("isLoggedIn");
    if (!isLoggedIn) {
      navigate("/");
    }
  }, [navigate]);

const gadgets = [
  {
    id: 1,
    name: "Laptop",
    image: "https://via.placeholder.com/150",
    description: "High-performance laptops for rent.",
    price: "$20/day",
  },
  {
    id: 2,
    name: "Camera",
    image: "https://via.placeholder.com/150",
    description: "DSLR cameras for photography enthusiasts.",
    price: "$15/day",
  },
  {
    id: 3,
    name: "Gaming Console",
    image: "https://via.placeholder.com/150",
    description: "PlayStation and Xbox consoles for gaming.",
    price: "$25/day",
  },
];


  return (
    <>
      <Navbar />
      <div className="h-full bg-gray-100 p-4">
        <h1 className="text-3xl font-bold text-center text-blue-500 mb-8">
          Welcome to QuickRent Dashboard
        </h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {gadgets.map((gadget) => (
            <div
              key={gadget.id}
              className="bg-white shadow rounded p-4 text-center"
            >
              <h2 className="text-xl font-bold">{gadget.name}</h2>
              <p className="text-gray-600">{gadget.price}</p>
              <button className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
                Rent Now
              </button>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default Dashboard;
